export const COLUMNS = [
    {
        Header: 'Name',
        accessor: 'name',      
        disableSortBy: true,
        render: ({ row }) => (<Link to={{ pathname: `/foo/${row.id}` }}>{row.name}</Link>)        
    },
    {
        Header: 'Description',
        accessor: 'description',
        disableSortBy: true
    },
    {
        Header: 'Price',
        accessor: 'initial_price',
        disableGlobalFilter: true
    }
]
